import React from "react";
import { NavLink } from "react-router-dom";
const NavBar = ()=>{
    return (
        <div className="nav">
            <h2>Personal Portfolio</h2>
            <NavLink to='/' className='navbar_item'> Home </NavLink>
            <NavLink to='/' className='navbar_item'> About </NavLink>
            <NavLink to='/' className='navbar_item'> Home </NavLink>
        </div>
    
    )
};

export default NavBar;
